import React from 'react';
import { View, Panel, PanelHeader } from '@vkontakte/vkui';
import '@vkontakte/vkui/dist/vkui.css';

class App extends React.Component {
    constructor(props) {
        super(props)
        this.state={}
    }

    render() {
        return (
            <View>
                <Panel>
                    <PanelHeader>Это заголовок</PanelHeader>
                    Это тело
                </Panel>
            </View>
        )
    }
}

export default App;
